import React from "react";
import styled from "styled-components";
import landing from "../illustration.jpg";
import googleIcon from "../googleIcon.png";

const Main = styled.div`
  display: flex;
  flex-direction: row;
  width: 100%;
  height: 100%;
  align-items: center;
  margin: 0;
  padding: 0;
`;

const LeftContainer = styled.div`
  background: white;
  height: 100%;
  width: 50%;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 70px;
`;

const RightContainer = styled.div`
  height: 100%;
  width: 50%;
  background: url(${landing});
  background-position: 0px -50px;
  background-size: cover;
`;

const LoginText = styled.h1`
  font-family: "Poppins";
  font-weight: 700;
  font-size: 28px;
  color: black;
`;

const Text2 = styled.h6`
  font-family: "Quicksand";
  font-weight: 700;
  font-size: 12px;
  color: #989898;
  margin-top: 4px;
`;

const SignInWithGoogle = styled.div`
  width: 40%;
  height: 38px;
  border-radius: 20px;
  margin-top: 30px;
  box-shadow: rgba(0, 0, 0, 0.05) 0px 6px 24px 0px,
    rgba(0, 0, 0, 0.08) 0px 0px 0px 1px;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const GoogleIcon = styled.div`
  background: url(${googleIcon});
  background-size: cover;
  width: 20px;
  height: 20px;
  margin-right: 8px;

  img {
    width: 100%;
    height: 100%;
  }
`;

const Text3 = styled.h5`
  font-family: "Poppins";
  font-weight: 600;
  font-size: 12px;
  color: black;
`;

const Text4 = styled.h6`
  font-family: "Quicksand";
  font-weight: 700;
  font-size: 11px;
  color: #989898;
  background-color: white;
  margin-top: 20px;
  width: 100%;

  &:before,
  &:after {
    background-color: #d3d3d3;
    content: "";
    display: inline-block;
    height: 0.01em;
    position: relative;
    vertical-align: middle;
    width: 15%;
  }

  &:before {
    right: 0.5em;
    margin-left: 10px;
  }

  &:after {
    left: 0.5em;
    margin-right: 10px;
  }
`;

const BackgroundFilter = styled.div`
  height: 100%;
  width: 100%;
  background-color: rgba(38, 70, 83, 0.7);
  display: flex;
`;

function SignupPage() {
  return (
    <Main>
      <LeftContainer>
        <LoginText>Login</LoginText>
        <Text2>Login to upload your notes on cloud!</Text2>
        <SignInWithGoogle>
          <GoogleIcon />
          <Text3>Sign In with Google</Text3>
        </SignInWithGoogle>
        <Text4>or Sign In with Email</Text4>
      </LeftContainer>
      <RightContainer />
    </Main>
  );
}

export default SignupPage;
